import React from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import { Heart, User, LogOut, Shield } from 'lucide-react';

const Navbar = () => {
  const { user, isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const isLoginPage = location.pathname === '/login' || location.pathname === '/admin/login';

  return (
    <nav className="navbar">
      <div className="navbar-container">
        {/* Logo and Brand */}
        <Link to="/" className="navbar-brand">
          <Heart className="navbar-logo" />
          <span className="navbar-title">Path2Wellness</span>
        </Link>

        {/* Navigation Links */}
        <div className="navbar-nav">
          {!isAuthenticated && !isLoginPage && (
            <>
              <Link to="/login" className="nav-link">
                <User size={18} />
                Patient Login
              </Link>
              <Link to="/admin/login" className="nav-link admin-link">
                <Shield size={18} />
                Admin Login
              </Link>
            </>
          )}

          {isAuthenticated && (
            <>
              <div className="user-info">
                <span className="user-name">Welcome, {user.name}</span>
                <span className="user-type">
                  {user.userType === 'admin' ? 'Doctor' : 'Patient'}
                </span>
              </div>
              <button onClick={handleLogout} className="nav-link logout-btn">
                <LogOut size={18} />
                Logout
              </button>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
